INSERT INTO `events` VALUES (1,1,'Resident Evil: CapÃ­tulo final',NULL,NULL,'2017-01-01','#ResidentEvilCapÃ­tuloFinal','@Rcinematograf OR @cocinsa OR @TandasNi OR @TomatazosCom OR @SonyPicturesArg OR @cineteatroalfa OR @sonypictures_es OR #ResidentEvilCapÃ­tuloFinal','En una carrera a contrarreloj, Alice tendrÃ¡ que echar mano de viejos compaÃ±eros, ademÃ¡s de un nuevo e inesperado aliado. SerÃ¡ una batalla repleta de acciÃ³n contra hordas de zombis y nuevos monstruos mutantes. Entre haber perdido sus habilidades sobrehumanas y el inminente ataque de Umbrella, esta serÃ¡ la aventura mÃ¡s difÃ­cil de Alice para salvar a la humanidad, que estÃ¡ al borde de caer en el olvido.','resident-evil-capitulo-final','[\"5\",\"7\",\"14\",\"25\"]','https://www.youtube.com/watch?v=GO8IFO8_IjU',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','ACTIVE','R',3.5,106,NULL,NULL,0,0,NULL,NULL,NULL,NULL,NULL),(2,1,'xXx Reactivado',NULL,NULL,'2017-01-01','#xXxReactivado','fansdelcine OR AndesFilmsChile OR MoveeksMx OR TomatazosCom OR tandasni #xXxReactivado ','Xander, alias XXX, es un rebelde amante de los deportes extremos que adora romper las normas, y que colabora como agente encubierto del gobierno participando en numerosos episodios de riesgo. Tras un fatÃ­dico incidente, motivo por el cual todos le dan por muerto, Cage sale de su exilio auto impuesto y vuelve a la acciÃ³n de incÃ³gnito. SeguirÃ¡ la pista a Xiang, un autoritario y peligroso guerrero. ','xxx-reactivado','[\"2\",\"7\"]','https://www.youtube.com/watch?v=QaMmgCqRW8g',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','ACTIVE','PG-13',3.3,107,NULL,NULL,0,0,NULL,NULL,NULL,NULL,NULL),(3,1,'Bailarina',NULL,NULL,'2016-01-01','#BallerinaMovie','#BallerinaMovie','Felicia es una niÃ±a que, tras perder a sus padres, vive en un orfanato en su BretaÃ±a natal. Su pasiÃ³n es la danza y sueÃ±a con convertirse en una bailarina profesional. Para conseguirlo se escapa con la ayuda de su amigo VÃ­ctor y viaja hasta el ParÃ­s de 1879. AllÃ­ se harÃ¡ pasa