,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','ACTIVE','PG-13',4.2,116,NULL,NULL,0,0,NULL,NULL,NULL,NULL,NULL),(9,1,'Moana: Un mar de Aventuras',NULL,NULL,'2016-01-01','#MoanaUnMarDeAventuras','@Cinecolorfilms OR @CineModerno OR @DisneyStudiosLA OR @sdocompany OR #MoanaUnMarDeAventuras','Moana, es la hija adolescente del lÃ­der de una tribu que habita las islas del PacÃ­fico Sur, ella estÃ¡ dispuesta a resolver el misterio sobre sus antepasados.  Siguiendo el consejo de su abuela, la joven decide hacer oÃ­dos sordos a la prohibiciÃ³n de su padre de permanecer en la isla, y se lanza a los confines del OcÃ©ano en compaÃ±Ã­a de su mascota, un torpe gallo de nombre Heihei. En su camino se encontrarÃ¡n con Maui, un semidiÃ³s que cuenta con un anzuelo mÃ¡gico, que le da la habilidad de cambiar de forma. Juntos vivirÃ¡n una gran aventura en la que se enfrentarÃ¡n a feroces criaturas en una misiÃ³n casi imposible que les llevarÃ¡ a cruzar el mar abierto.','moana-un-mar-de-aventuras','[\"2\",\"3\",\"6\"]','https://www.youtube.com/watch?v=IifbEQqGKzc',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','ACTIVE','PG',4,107,NULL,NULL,0,0,NULL,NULL,NULL,NULL,NULL),(10,1,'Â¿Por quÃ© Ã©l?',NULL,NULL,'2016-01-01','#WhyHim','@WhyHimMovie OR @cinelander OR @Cine_Butaca OR #WhyHim','Ned Fleming (Bryan Cranston) es un cariÃ±oso pero sobreprotector padre, cuya imprenta se estÃ¡ yendo a pique ante la competencia de las empresas tecnolÃ³gicas. Durante las vacaciones, viaja a California junto a su familia para visitar a su hija Stephanie (Zoey Deutch). AllÃ­ conocerÃ¡ a su mayor pesadilla: Laird Mayhew (James Franco), un multimillonario diseÃ±ador de videojuegos de Silicon Valley que es el novio de su hija. ','por-que-el','[\"3\"]','https://www.youtube.com/watch?v=484KGBvJeP8',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','ACTIVE','R',3.3,111,NULL,NULL,0,0,NULL,NULL,NULL,NULL,NULL),(11,1,'Sing: Ven y Canta',NULL,NULL,'2016-01-01','#VenYCanta','@uipargentina OR @UniversalMX OR @SCinecolon OR @CINEMAADROGUEOK 